sourcesContent:
// full_server/utils.js
import fs from 'fs/promises';

async function readDatabase(filePath) {
  try {
    const data = await fs.readFile(filePath, 'utf8');
    // Parse and process the database file data
    // Return the processed data as needed
    return processData(data);
  } catch (error) {
    throw new Error('Cannot load the database');
  }
}

function processData(data) {
  // Process and return the data as needed
  // For simplicity, assuming data is in CSV format
  const lines = data.split('\n');
  const result = {};
  lines.forEach((line) => {
    const [field, firstName] = line.split(',');
    if (!result[field]) {
      result[field] = [];
    }
    result[field].push(firstName.trim());
  });
  return result;
}

export { readDatabase };

